import React from 'react';
import { Box } from '@mui/material';
import logo from '../../img/logo_roxo(2)_png.png'; 
import styles from './InicioTurmas.module.css';  // Importa o CSS module

const InicioTurmas = () => {
  return (
    <Box className={styles.container}>  {/* Aplica a classe container do CSS module */}
      <img
        src={logo}
        alt="Logo da Escola"
        className={styles.logo}  
      />
      {/* Aplica a classe logo do CSS module */}
    </Box>
  );
};

export default InicioTurmas;
